import React from 'react';
import FullCalendar from '@fullcalendar/react';
import dayGridPlugin from '@fullcalendar/daygrid';
import timelinePlugin from '@fullcalendar/timeline';

function ManageOrder() {
    const events = [
        { id: '1', title: 'Sự kiện 1', start: '2023-10-09T10:00:00', end: '2023-10-09T12:00:00' },
        { id: '2', title: 'Sự kiện 2', start: '2023-10-09T14:00:00', end: '2023-10-09T16:00:00' },
        { id: '3', title: 'Sự kiện 3', start: '2023-10-09T08:00:00', end: '2023-10-09T10:00:00' },
      ];
    
      return (
        <FullCalendar
          plugins={[timelinePlugin]}
          initialView="timelineWeek"
          events={events}
        />
      );
}

export default ManageOrder;
